import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  template: `
    <div class="app-container">
      <app-menu></app-menu>
      <main>
        <router-outlet></router-outlet>
      </main>
    </div>
  `,
  styles: [`
    .app-container {
      min-height: 100vh;
      background-color: #f5f5f5;
    }
    
    main {
      padding: 2rem 0;
    }
  `]
})
export class AppComponent {
  title = 'cadastro-pessoas';
}
